import React from 'react';
import classes from "./Contact.module.css";
import { ImLinkedin,SiInstagram,SiGithub,SiHackerrank } from 'react-icons/fa';

const Contact = () =>{
    return(
        <>
        <div className={classes.Contact}>
         <div className={classes.ContactIcons}>
             <ImLinkedin color='white' size='130px' style={{padding:'1%'}} onClick={handleURL('https://www.linkedin.com/in/ritik-ahlawat-28b1371ab/')}></ImLinkedin>
         </div>
        </div> 
        </>
    );
}

export default Contact;
